import React, { useState } from 'react';
import Navbar from './Navbar';
import ContactPage from './ContactPage';
import Home from './Home';

const App = () => {
  const [formData, setFormData] = useState(null);

  const saveData = (data) => {
    // Save the form data in local storage or perform any desired action
    setFormData(data);
  };

  const clearLocalStorage = () => {
    // Clear the data stored in local storage or perform any desired action
    setFormData(null);
  };

  return (
    <div>
      <Navbar />
      <Home clearLocalStorage={clearLocalStorage} storedData={formData} />
      <ContactPage saveData={saveData} />
    </div>
  );
};

export default App;
